import React, { Component } from "react";
import logo from "./logo.svg";
import "./App.css";

import { tareas } from "./tareas";

function App() {
  return (
    <div className="App">
      <nav className="navbar navbar-dark bg-dark">
        <a href="" className="text-white">
          Lista de tareas
        </a>
      </nav>
      <img src={logo} className="App-logo" alt="logo" />
    </div>
  );
}

export default App;
